"   <div class=\"block mop drugH1Div\" id=\"F158702\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     CNS activity, blood pressure, pulse; height, weight, growth parameters; appetite; signs/symptoms of tolerance or dependence",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     When used for the treatment of ADHD, thoroughly evaluate for cardiovascular risk.   Monitor heart rate, blood pressure, and consider obtaining ECG prior to initiation (Vetter, 2008).",
"    </p>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F158691\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Amphetamines are noncatecholamine, sympathomimetic amines that promote release of catecholamines (primarily dopamine and norepinephrine) from their storage sites in the presynaptic nerve terminals.  A less significant mechanism may include their ability to block the reuptake of catecholamines by competitive inhibition.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F158709\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: 30-60 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 4-6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Well-absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : Adults: 3.5-4.6 L/kg; distributes into CNS, mean CSF concentrations are 80% of plasma",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Children 6-12 years: d-amphetamine: 9 hours; l-amphetamine: 11 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adolescents 13-17 years: d-amphetamine: 11 hours; l-amphetamine: 13-14 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults: d-amphetamine: 10 hours; l-amphetamine: 13 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via cytochrome P450 monooxygenase and glucuronidation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: T",
"     <sub>",
"      max",
"     </sub>",
"     : Adderall&reg;: 3 hours; Adderall XR&reg;: 7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (highly dependent on urinary pH); 70% of a single dose is eliminated within 24 hours; excreted as unchanged amphetamine (30%, may range from ~1% in alkaline urine to ~75% in acidic urine), benzoic acid, hydroxyamphetamine, hippuric acid, norephedrine, and",
"     <i>",
"      p",
"     </i>",
"     -hydroxynorephedrine",
"    </p>",
"   </div>",
"  </div>",
