var title_f43_41_44701="Outcome Brugada Syndrome by presentation";
var content_f43_41_44701=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80714&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80714&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Outcome of patients with Brugada Syndrome depends upon the clinical presentation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 385px; height: 324px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In a study of 334 patients with the Brugada Syndrome, the incidence of arrhythmic events (sudden cardiac death or documented ventricular fibrillation) during follow-up depended upon the clinical presentation. The outcome was best for those who were asymptomatic and presented with an abnormal ECG, intermediate for those presenting with syncope, and worst in patients with aborted sudden cardiac death.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Brugada J, Brugada R, Antzelevitch C, et al. Circulation 2002; 105:73.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
